import React from "react";
import { Link } from "react-router-dom";
import Home from "../pages/Home";

const Navbar = () => {
  return (
    <header>
      <div className="container">
        <Link to="/">
          <Home/>
          <h1>Workout Buddy</h1>
        </Link>
      </div>
    </header>
  );
};

export default Navbar;
